//! ポケモンのデータを保持する。

use std::collections::HashMap;

use super::moves::*;

#[derive(Debug)]
pub struct Pokepedia {
    pub no: &'static str,
    pub name: &'static str,
    pub type1: MoveType,
    pub type2: Option<MoveType>,

    // 種族値
    pub attack_st: i32,
    pub defense_st: i32,
    pub stamina_st: i32,

    // 技
    pub fast_moves: &'static [&'static FastMove],
    pub charge_moves: &'static [&'static ChargeMove],
}

/// ポケモンNoからポケモン情報を取得するマップを返す。
pub fn get_pokepedia_by_no() -> HashMap<String, &'static Pokepedia> {
    let mut m = HashMap::with_capacity(NUM_POKEPEDIA);

    for p in &POKEPEDIA {
        m.insert(p.no.to_string(), p);
    }

    m
}

#[test]
fn test_get_pokepedia_by_no() {
    let m = get_pokepedia_by_no();
    assert_eq!(m["0909"].name, "ホゲータ");
}

/// ポケモン名からポケモン情報を取得するマップを返す。
pub fn get_pokepedia_by_name() -> HashMap<String, &'static Pokepedia> {
    let mut m = HashMap::with_capacity(NUM_POKEPEDIA);

    for p in &POKEPEDIA {
        m.insert(p.name.to_string(), p);
    }

    m
}

#[test]
fn test_get_pokepedia_by_name() {
    let m = get_pokepedia_by_name();
    assert_eq!(m["ホゲータ"].no, "0909");
}

